drop database if exists coral_bleaching;
create database if not exists coral_bleaching;
use coral_bleaching;

-- severity
DROP TABLE IF EXISTS severity;
CREATE TABLE severity (
   severity_id INT PRIMARY KEY AUTO_INCREMENT,
   severity_desc VARCHAR(30) NOT NULL
  );
 
 -- mortality
DROP TABLE IF EXISTS mortality;
CREATE TABLE mortality (
   mortality_id INT PRIMARY KEY AUTO_INCREMENT,
   description VARCHAR(200),
   percentage INT
  );
  
  -- recovery
DROP TABLE IF EXISTS recovery;
CREATE TABLE recovery (
   recovery_id INT PRIMARY KEY AUTO_INCREMENT,
   description VARCHAR(200) NOT NULL
  );
 
-- source
DROP TABLE IF EXISTS source;
CREATE TABLE source (
   source_id INT PRIMARY KEY AUTO_INCREMENT,
   source_name VARCHAR(1000) NOT NULL
  );
  
-- region
DROP TABLE IF EXISTS region;
CREATE TABLE region (
   region_id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
   region_name VARCHAR(200)
 );
 
 -- subregion
DROP TABLE IF EXISTS subregion;
CREATE TABLE subregion (
   subregion_id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
   subregion_name VARCHAR(200),
   region_id INT NOT NULL,
   CONSTRAINT subregion_fk_region FOREIGN KEY (region_id) REFERENCES region (region_id)
 );
 
-- country
DROP TABLE IF EXISTS country;
CREATE TABLE country (
   country_id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
   country_name VARCHAR(200),
   subregion_id INT NOT NULL,
   CONSTRAINT country_fk_subregion FOREIGN KEY (subregion_id) REFERENCES subregion (subregion_id)
 );

-- location
DROP TABLE IF EXISTS location;
CREATE TABLE location (
   location_id INT PRIMARY KEY AUTO_INCREMENT,
   location_name VARCHAR(200),
   country_id INT NOT NULL,
   subregion_id INT NOT NULL,
   region_id INT NOT NULL,
   CONSTRAINT location_fk_country FOREIGN KEY (country_id) REFERENCES country (country_id),
   CONSTRAINT location_fk_subregion FOREIGN KEY (subregion_id) REFERENCES subregion (subregion_id), 
   CONSTRAINT location_fk_region FOREIGN KEY (region_id) REFERENCES region (region_id)
  );
 
-- entry
DROP TABLE IF EXISTS entry;
CREATE TABLE entry (
   entry_id INT PRIMARY KEY AUTO_INCREMENT,
   month INT,
   year INT NOT NULL,
   percentage_affected VARCHAR(100),
   water_temp VARCHAR(100),
   coral_species VARCHAR(3200),
   coral_family VARCHAR(3200),
   latitude VARCHAR(20) NOT NULL,
   longitude VARCHAR(20) NOT NULL,
   location_id INT NOT NULL,
   -- source_id INT, -- was not null
   severity_id INT NOT NULL,
   mortality_code INT,
   -- recovery_id INT,
   CONSTRAINT entry_fk_location FOREIGN KEY (location_id) REFERENCES location (location_id),
   -- CONSTRAINT entry_fk_source FOREIGN KEY (source_id) REFERENCES source (source_id), 
   CONSTRAINT entry_fk_severity FOREIGN KEY (severity_id) REFERENCES severity (severity_id)
   -- CONSTRAINT entry_fk_mortality FOREIGN KEY (mortality_id) REFERENCES mortality (mortality_id), 
   -- CONSTRAINT entry_fk_recovery FOREIGN KEY (recovery_id) REFERENCES recovery (recovery_id)
  );
select * from entry;
